import {NavLink} from 'react-router-dom'
import s from './Header.module.css'

function Header() {
    let isActiv
    const onClickHandler = (s: string) => {
        isActiv = s
    }
    return (
        <div className={s.wrapper}>
            <div className={s.navBox}>
                {/*// add NavLinks*/}
                <NavLink to={'/'} className={`${s.navLinck} ${isActiv}` } onClick={(event)=>onClickHandler('activ')}>pre-junior</NavLink>
                {/*<NavLink to={'/zalupa'} className={`${s.navLinck} ${onClickHandler}` } onClick={(event)=>onClickHandler(event)}>junior</NavLink>*/}
                {/*<NavLink to={'/zalupa+'} className={`${s.navLinck} ${onClickHandler}` } onClick={(event)=>onClickHandler(event)}>junior+</NavLink>*/}
                <div className={s.navLinckBtn}>x</div>
            </div>
        </div>
    )
}

export default Header
